import Layers from './Layers';
import Heatmap from './Heatmap';
import Tile from './Tile';
import Vector from './Vector';
import VectorImage from './VectorImage';
import WebGLPoints from './WebGLPoints';

const Layer = {
  Heatmap,
  Tile,
  Vector,
  VectorImage,
  WebGLPoints,
};

export { Layers, Layer };
